export enum SN_RULE {
  LETTER = 1,
  NUMBER = 2
}

export enum SN_GENERATE_RULE {
  RANDOM = 1,
  FIXED = 2
}

export enum CONTRACT_TYPE {
  /**
   * 会员卡合同
   */
  MEMBER_CARD = 1,
  /**
   * 私教课程合同
   */
  PERSONAL = 2,
  /**
   * 课程包合同
   */
  PACKAGE = 3,
  /**
   * 储值卡合同
   */
  DEPOSITE = 4,
  /**
   * 储物柜合同
   */
  CABINET = 5,
  /**
   * 定金合同
   */
  MONEY = 6,
  /**
   * 小班课合同
   */
  SMALL_COURSE = 7
}
